using namespace std;

class TrieNode {
    public:
    map<int, TrieNode*> child;
};

class Solution {
public:
    int findMaximumXOR(vector<int>& nums) {
     if(nums.size() < 2) {
        return 0;
     }
     int maxLen = getLen(getMax(nums));   
     TrieNode root;
     for(auto num : nums) {
        insertToTrie(root, num, maxLen);
     }

     int maxXOR = 0;
     for(auto num : nums) {
        auto curXOR = getMaxXOR(root, num, maxLen);
        if(curXOR > maxXOR) {
            maxXOR = curXOR;
        }
     }



     return maxXOR;
    }

    void insertToTrie(TrieNode & root, int num, int maxLen) {
        int andBit = 1 << (maxLen - 1);
        TrieNode * nextRoot = &root;
        for(int i = 0; i < maxLen; i++) {
            int curBit = (andBit & num) >> (maxLen - i - 1);
            andBit = andBit >> 1;

            if(nextRoot->child[curBit] == nullptr) {
                nextRoot->child[curBit] = new TrieNode();
            }
            nextRoot = nextRoot->child[curBit];
        }
    }

    int getMaxXOR(TrieNode & root, int num, int maxLen) {
        int andBit = 1 << (maxLen - 1);
        TrieNode * curRoot= &root;
        TrieNode * nextRoot = &root;
        int maxXOR = 0;
        for(int i = 0; i < maxLen; i++) {
            int curBit = (andBit & num) >> (maxLen - i - 1);
            andBit = andBit >> 1;

            int flipBit = 0;
            if(curBit == 0) {
                flipBit = 1;
            }

            maxXOR = maxXOR << 1;
            if(curRoot->child[flipBit] != nullptr) {
                maxXOR = maxXOR | 1;
                curRoot = curRoot->child[flipBit];
            } else {
                curRoot = curRoot->child[curBit];
            }
        }
        return maxXOR;
    }

    int getMax(vector<int>& nums) {
        int max = nums[0];
        for(auto cur : nums) {
            if(cur > max) {
                max = cur;
            }
        }
        return max;
    }

    int getLen(int num) {
        int i = 0;
        while(num > 0) {
            num = num >> 1;
            i++;
        }
        return i;
    }
};

